%[text] # **Chart Examples: Getting Started**
%[text] ## Overview
%[text] This toolbox contains the MATLAB code and examples for the technical article [*Creating Specialized Charts with MATLAB Object-Oriented Programming*](<matlab: web("https://www.mathworks.com/company/newsletters/articles/creating-specialized-charts-with-matlab-object-oriented-programming.html")>).
%[text] A chart provides a task-specific application programming interface (API) for creating custom visualizations. Designing and implementing a chart not only provides a convenient API for end users, but simultaneously removes the need for the user to manipulate low-level graphics objects. 
%[text] This toolbox comprises several diverse examples of custom MATLAB charts, together with an app for browsing the available charts and their documentation. You can inspect the source code, explore the features and functionality, and run examples demonstrating the use of each chart. The toolbox also has documentation and resources to help you develop your own charts.
%[text] ![](text:image:23da)
%[text] ## Chart List
%[text] - `AircraftChart`: Visualize an aircraft and modify its roll, pitch, and yaw
%[text] - `AnnulusChart`: Visualize relative proportions in a data vector using an annulus (ring)
%[text] - `CircularNetFlowChart`: Show directed to/from relationships between pairs of categories
%[text] - `ClockChart`: Display an analog clock, using a timer to schedule regular updates
%[text] - `CylinderChart`: Plot data using stacked cylinders
%[text] - `EdgeworthBowleyChart`: Plot the utility curves of two individuals and the derived Pareto-efficient contract curve
%[text] - `GraphicsHierarchyChart`: Visualize the graphics hierarchy descending from a given graphics object
%[text] - `ImpliedVolatilityChart`: Plot an implied volatility surface as a function of the option strike price and time to expiry
%[text] - `LineGradientChart`: Plot a variable-color curve against a date/time vector
%[text] - `LineSelectorChart`: Display a collection of line plots and select one to highlight
%[text] - `PolarChart`: Polar line graph of dependent numeric variables plotted against independent circular data
%[text] - `RadarScope`: Plot a set of blips on a radar scope and issue proximity alerts
%[text] - `RangefinderChart`: Bivariate scatter plot showing the crossover point of the marginal medians and lines indicating the marginal adjacent values
%[text] - `SankeyChart`: Illustrate the flow between different states
%[text] - `ScatterBoxChart`: Bivariate scatter plot with marginal boxplots
%[text] - `ScatterDensityChart`: Bivariate scatter plot using color to indicate relative density of the data points
%[text] - `ScatterFitChart`: Manage bivariate scattered data together with the line of best fit
%[text] - `SettlementChart`: Plot in the money option prices against strike prices
%[text] - `SignalTraceChart`: Plot non-overlapping signal traces against a numeric time vector
%[text] - `SnailTrailChart`: Plot excess returns against tracking errors for an asset relative to a benchmark
%[text] - `SpiderChart`: Plot and compare values from distinct measurements on a web
%[text] - `TernaryChart`: Barycentric plot of three variables summing to a constant
%[text] - `ValueAtRiskChart`: Plot the distribution of a return series together with its value at risk metrics and a distribution fit
%[text] - `WaterfallChart`: Cumulative bar chart visualizing the evolution of an initial value
%[text] - `WindRoseChart`: Display wind speed and direction data on a polar histogram \
%[text] ## [MathWorks](<matlab: web("https://www.mathworks.com")>) Product Requirements
%[text] This toolbox requires MATLAB release R2025a or later.
%[text] - [MATLAB](<matlab: web("https://www.mathworks.com/products/matlab.html")>) \
%[text] Some example charts in the toolbox rely on additional toolboxes
%[text] ## Documentation and Chart Examples
%[text] Open the `Chart Browser` app from the MATLAB apps gallery to browse the documentation and chart examples.
